import React from "react";

const Cards = ({ results }) => {
  let display;

  if (results) {
    display = results.map((result) => {
      return (
        <div className="col-4" key={result.id}>
          {result.name}
        </div>
      );
    });
  } else {
    display = "No characters found! :(";
  }

  return <div className="col-4">{display}</div>;
};

export default Cards;
